import React from "react";
import { Link } from 'react-router-dom';
import Artists from "./Artists";


function ArtistsCard(props) {
    return (
        <div class="card  artist-card p-2 border-0">

            <div class="d-flex justify-content-center mt-2">
                <img class="card-img-top circle-image" src={props.image_url} alt="artistsPic" />
            </div>

            <div class="card-body text-start d-flex flex-column">
                <a class =" artist-card-link artist-card-title" to={'/artists/artistspage/${artist}'}>{props.name}</a>
                <span><h1 class ="artist-card-text">#{props.popularity}</h1></span>
                <span><h1 class ="artist-card-text"><Link class="artist-card-link artist-card-genre" to={'/genre/${props.genreId}'}>{props.genreId}</Link></h1></span>
                <span><h1 class ="artist-card-text">Latest Album : {props.albums[0]}</h1></span>
            </div>

            <div class="card-body text-start d-flex flex-column">
                <h1  class ="artist-card-subtitle">Venues</h1>
                <span><Link class="artist-card-link artist-card-text" to={'/venue/${props.futureEvents[0]}'}>{props.futureEvents[0]}</Link></span>
                <span><Link class="artist-card-link artist-card-text" to={'/venue/${props.futureEvents[1]}'}>{props.futureEvents[0]}</Link></span>
                <span><Link class="artist-card-link artist-card-text" to={'/venue/${props.futureEvents[0]}'}>{props.futureEvents[0]}</Link></span>
                <span><a class="artist-card-link artist-card-text" href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">{props.futureEvents[1]}</a></span>
                <span><a class="artist-card-link artist-card-text"  href="https://getbootstrap.com/docs/5.3/utilities/flex/#justify-content">{props.futureEvents[2]}</a></span>
            </div>

        </div>
    );
}

export default ArtistsCard;
